import React from 'react';
import { NavLink } from 'react-router-dom';

export const Wrapper = ({ children }) => (
	<section className="w-80 center mt4 flex justify-between flex-wrap">
		{children}
	</section>
);

export const Card = ({ back, title, to }) => (
	<NavLink to={to} className="mb3 w-32 h7">
		<div className="flex absolute h-7 hover-gold pa3 futura ttu fire-opal tc items-center fw7 f1">
			{title}
		</div>
		<img src={back} alt="prj" className="obj-cover" />
	</NavLink>
);
